//styles
import "./SearchButton.scss"

//assets
import search from "../../../../assets/images/search.png"

const SearchButton = () => {
    return (
        <button className="btnSearch" onClick={() => navigate('/search')}>
            Search
            <img src={search} />
        </button>
    )
}

export default SearchButton
